import React from 'react';
import EventList from '../components/EventList';
import { getToken } from '../api';

const Home = () => {
  const userId = getToken().userId; // Supposons que getToken() renvoie un objet contenant userId

  return (
    <div>
      <h1>Event Manager</h1>
      <EventList userId={userId} />
    </div>
  );
};

export default Home;
